import React from 'react';
import './App.css';

function App() {
  return (
      <div>
          <div>
              <div>
                  <img alt="" src={"./images/LogoCard.bmp"} />
              </div>
          </div>

          <div id="thumbnail">
              <img class="loading content-fill" alt="" src={"./images/cecistyle1.jpg"} />
          </div>
      </div>
  );
}

export default App;
